import Hero from "../components/Hero";
import Navbar from "../components/Navbar"
import AboutImg from "../assests/img1.jpg"
import Footer from "../components/Footer";

function About(){
    return(
        <>
        <Navbar /> 
        <Hero 
        cName="hero-mid"
        heroImg = {AboutImg}
        title = "About"
        btnClass="show"/>
        <AboutUs />
        <Footer />
        </>
    )
}

export default About;
